"use strict";(self.webpackChunknumerology_it=self.webpackChunknumerology_it||[]).push([[733],{733:e=>{e.exports=JSON.parse('{"ANALYSIS":{"DESTINY":"ABC"},"general":{"add":"Adicionar","addMore":"compare"},"Pythagorean":"Pitag\xf3rico","Kaballah":"Cabal\xedstico","motivation":{"name":"Motiva\xe7\xe3o","description":"O n\xfamero de Motiva\xe7\xe3o descreve os motivos e as raz\xf5es que movem as atitudes do ser humano e o seu modo de proceder. Esse n\xfamero revela o aspecto interior da personalidade, da alma, que se reflete em suas atitudes e comportamentos, principalmente na intimidade e no lar, influenciando ainda nas escolhas pessoais. Nem sempre h\xe1 coer\xeancia, pois, a atitude interior da pessoa, muitas vezes, n\xe3o \xe9 revelada para os outros, mas rege as suas decis\xf5es intuitivas. O n\xfamero de Motiva\xe7\xe3o revela as cren\xe7as e os valores internos da pessoa, mobilizando seus desejos, suas ambi\xe7\xf5es e os sentimentos mais \xedntimos que o impulsionam a buscar determinados caminhos para as suas realiza\xe7\xf5es na vida. Revela a ess\xeancia da personalidade."},"impression":{"name":"Impress\xe3o","description":"O n\xfamero de Impress\xe3o descreve a personalidade em seu aspecto externo, o ego, ou seja, a apar\xeancia da personalidade atual. \xc9 o n\xfamero que descreve aquela primeira impress\xe3o que a pessoa causa quando \xe9 vista por outro. Nem sempre essa primeira impress\xe3o \xe9 coerente com a atitude interior da pessoa. Essa aparente diverg\xeancia, no entanto, n\xe3o reflete distor\xe7\xe3o da personalidade e sim apenas um engano de quem se deixa levar pelas apar\xeancias e n\xe3o busca conhecer a ess\xeancia da pessoa."},"expression":{"name":"Express\xe3o","description":"O n\xfamero de Express\xe3o enuncia a maneira como a pessoa age e interage com os outros e com o mundo, revelando quais s\xe3o os verdadeiros talentos e aptid\xf5es que desenvolver\xe1 ao longo da vida, e a melhor forma de express\xe1-los. Revela o car\xe1ter da personalidade, as caracter\xedsticas que se expressam nas a\xe7\xf5es pessoais, refletindo-se nos v\xe1rios campos da vida. A express\xe3o \xe9 a pr\xf3pria maneira de agir do ser humano no uso da sua personalidade, motivada pelos seus conte\xfados internos, da Alma (a Motiva\xe7\xe3o) e externos, do Ego (a Impress\xe3o), resumindo o conjunto completo da sua personalidade. \xc9 o n\xfamero do nome da pessoa."},"destiny":{"name":"Destino","description":"O n\xfamero de destino \xe9 determinado pela data de nascimento - dia, m\xeas e ano. O destino rege a vida do ser humano e indica o seu \\"caminho\\" evolutivo. Ele orienta as decis\xf5es mais importantes na vida; aquelas que determinam o que resultar\xe1 das aplica\xe7\xf5es dos seus dons e talentos nas suas realiza\xe7\xf5es pessoais conforme for a sua voca\xe7\xe3o. \\nO destino \xe9 a pr\xf3pria constru\xe7\xe3o da vida que cada um escolhe, ou que lhe \xe9 destinado por determina\xe7\xe3o da exist\xeancia e pelas suas necessidades evolutivas. Ele representa a energia c\xedclica com a qual o ser humano se desenvolver\xe1 numa determinada etapa da sua exist\xeancia - uma vida no plano f\xedsico. A nossa evolu\xe7\xe3o est\xe1 destinada por inarred\xe1vel lei c\xf3smica; porquanto tentemos nos retardar, chegar\xe1 o momento que o avan\xe7o ser\xe1 por imposi\xe7\xe3o da lei."},"mission":{"name":"Miss\xe3o","description":"Todos n\xf3s temos uma miss\xe3o e o conhecimento dessas particularidades suavizam a evolu\xe7\xe3o e a nossa experi\xeancia de vida. N\xe3o conhecer nosso prop\xf3sito e os aspectos que a ele est\xe3o associados podem tornar a vida muito mais complicada, estagnada e dif\xedcil, nos trazendo ainda mais os efeitos da Lei do Karma."},"psychicNumber":{"name":"N\xfamero Ps\xedquico","description":"O N\xfamero Ps\xedquico revela como s\xe3o as qualidades ps\xedquicas que influenciam nas escolhas pessoais, como alimento, sexo, amizades, relacionamentos, casamento e profiss\xe3o, e nas ambi\xe7\xf5es e desejos. Revela como a pessoa se v\xea interiormente e como lida com as suas for\xe7as interiores da personalidade. \xc9, ainda, o n\xfamero que reflete certos padr\xf5es interiores comuns a grupos de pessoas nascidas em determinados dias comuns entre si."},"personalYear":{"name":"Ano Pessoal","description":"Cada ano universal (de 01 de janeiro a 31 de dezembro) possui caracter\xedsticas espec\xedficas e vibra\xe7\xf5es peculiares que influenciam a coletividade humana. Mas existem tamb\xe9m os anos pessoais que, do mesmo modo, influenciam particularmente a vida de cada ser humano. O Ano Pessoal come\xe7a do dia do anivers\xe1rio e termina na v\xe9spera do pr\xf3ximo anivers\xe1rio, e exerce forte influ\xeancia sobre a vida da pessoa. Cada Ano Pessoal traz um conjunto de oportunidades e aprendizados espec\xedficos; que, sendo seguidas, a vida ser\xe1 mais prof\xedcua."},"personalMonth":{"name":"M\xeas Pessoal","description":"Assim como existem os anos pessoais, tamb\xe9m os meses pessoais influenciam de certa maneira a vida da pessoa. Cada m\xeas do ano tem sua vibra\xe7\xe3o peculiar, e cada ser humano segue, de acordo com a sua data de nascimento, uma sequ\xeancia mensal pessoal, que pode ser aproveitada para se orientar nas suas decis\xf5es pessoais."},"personalDay":{"name":"Dia Pessoal","description":"Cada dia possui suas peculiaridades e influencia a coletividade humana. Individualmente, pessoa pode se orientar pelo seu dia pessoal. Assim como a Astrologia, a Numerologia Cabal\xedstica tamb\xe9m serve como um orientador di\xe1rio."}}')}}]);